content.text:
I have a stat bar display issue. The colored bar (showing the stat value) is not filling the full height of the background track container. Here's the current CSS:

```css
.stat-bar-container {
    margin-top: 10px;
    height: 10px;
    background: rgba(255, 255, 255, 0.1);
    border-radius: 5px;
    overflow: hidden;
    position: relative;
}

.stat-bar {
    position: absolute;
    top: 0;
    left: 0;
    height: 100%;
    background: linear-gradient(90deg, var(--red-dark), var(--gold));
    border-radius: 5px;
    z-index: 2;
}

.stat-bar-max {
    background: linear-gradient(90deg, var(--rust), var(--gold));
    opacity: 0.4;
    z-index: 1;
}
```

The colored bar should fill the full height of the container but it appears shorter. What's causing this and how do I fix it?

messages.content:
The most common cause here is that the **`.stat-bar` element is an inline element (often a `span`)**, and inline elements **ignore `height`**. Even with `position:absolute`, the height wont render as expected unless the element is block-level.

**Fix:** make the bar block-level and pin it to all edges so it fills the track.

```css
.stat-bar-container {
  position: relative;
  height: 10px;
  /* keep the rest */
}

.stat-bar,
.stat-bar-max {
  position: absolute;
  inset: 0;          /* replaces top/left/height and ensures full height */
  display: block;    /* critical if you're using a <span> */
  border-radius: 5px;
}
```

If you **need different widths** for the bars, keep `width` on `.stat-bar` and `.stat-bar-max` (or set `.stat-bar-max { width: 100%; }`).

This will guarantee the color bar fully fills the track height.

